import React from 'react';

import User from '../User/User';

const UserList = props => {
  if (props.users.length > 0) {
    return <ul className="users-list">
      {props.users.map(user => (
        <User
          key={user.id}
          name={user.name}
          age={user.age}
        />)
      )}
    </ul>;
  }
};

export default UserList;
